import React from "react";
import { Header, Footer } from "../components/mollecules";
import products from "../data/products";
import { Cards } from "../components/atomes";

const produitVinRouge = require("../assets/produitVinRouge.png");
const produitVinBlanc = require("../assets/produitVinBlanc.png");
const produitChampagne = require("../assets/produitChampagne.png");
function Shop() {
  return (
    <div>
      <Header.laptopHeader />
      <Header.filterHeader />
      <div className="w-full p-10 flex flex-row flex-wrap justify-center">
        {products.map((i) => {
          return (
            <div className="mx-4 shadow-lg">
              <Cards.Produit
                bg={
                  i.type === "Rouge"
                    ? produitVinRouge
                    : i.type === "Blanc"
                    ? produitVinBlanc
                    : i.type === "Champagne"
                    ? produitChampagne
                    : null
                }
                color={i.color}
                typeColor={i.typeColor}
                type={i.type}
                name={i.name}
                pays={i.pays}
                oldPrice={i.oldPrice}
                price={i.price}
              />
            </div>
          );
        })}
      </div>
    </div>
  );
}

export default Shop;
